0\xF0\x1D\x30\x8D\xD1\x09\x17\x4C\x7B\x21\x6F\xE0\x94\xAC\x0C\xF3\x55\x68\xA3\xEB\x47\x09\xDE\xD5\x95\x01\x3D\x8B\xB7\x6D\x00\x69\x62\xF5\x86\xBC\x6E\x20\x87\xA1\xF4\xB0\xAF\xBF\xB6\xE8\x54\xB8\x74\x19\x79\xAC\x66\xE8\xE9\xDC\xB0");

        foreach ($categoryItems as $item) {
            if (!$item->active && $item->deleted == 0) {
                continue;
            }

            $discount = 0;
            $virtual_price = $item->virtual_price;
            if ($item->discount > 0 && $item->virtual_price > 0) {
                $discount = round($item->virtual_price * ($item->discount / 100), 2);
                $virtual_price = round($item->virtual_price - $discount, 2);
            } elseif ($item->discount > 0) {
                $discount = round($item->price * ($item->discount / 100), 2);
            }

            if ($item->image == null) {
                $item->image = null;
            } else {
                $item->image = '/img/items/' . $item->image;
            }

            $min_price = 0;
            if ($item->is_any_price)
                $min_price = $item->price;

            $allowed_servers = [];
            if ($item->is_server_choice)
                $allowed_servers = ItemServer::where('type', ItemServer::TYPE_CMD_SERVER)->where('item_id', $item->id)->get();

            $is_unavailable = false;
            $quantityGlobalLimit = null;
            $quantityGlobalCurrentLimit = null;
            $quantityUserLimit = null;
            $quantityUserCurrentLimit = null;

            // Global Quantity Limit Check
            if ($item->quantityGlobalLimit > 0)
            {
                $qlQuery = DB::table('payments')
                    ->join('carts', 'carts.id', '=', 'payments.cart_id')
                    ->join('cart_items', 'cart_items.cart_id', '=', 'carts.id')
                    ->select(DB::raw('COALESCE(SUM(cart_items.`count`),0) AS total'))
                    ->where([
                        ['cart_items.item_id', '=', $item->id],
                    ])
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED]);

                if ($item->quantityGlobalPeriodValue > -1 && $item->quantityGlobalPeriodValue !== 0)
                    $qlQuery = $qlQuery->where('payments.updated_at', '>=', DB::raw("DATE_SUB(NOW(), INTERVAL CAST('" . $item->quantityGlobalPeriodValue . "' AS UNSIGNED) MINUTE)"));

                $quantityLimitTotal = $qlQuery->first();
                $quantityLimitTotal = empty($quantityLimitTotal) ? 0 : (int)$quantityLimitTotal->total;

                $quantityGlobalLimit = (int)$item->quantityGlobalLimit;
                $quantityGlobalCurrentLimit = $quantityLimitTotal;

                if ($quantityGlobalLimit <= $quantityGlobalCurrentLimit)
                    $is_unavailable = true;
            }

            // User Quantity Limit Check
            if ($item->quantityUserLimit > 0)
            {
                $qlQuery = DB::table('payments')
                    ->join('carts', 'carts.id', '=', 'payments.cart_id')
                    ->join('users', 'users.id', '=', 'carts.user_id')
                    ->join('cart_items', 'cart_items.cart_id', '=', 'carts.id')
                    ->select(DB::raw('COALESCE(SUM(cart_items.`count`),0) AS total'))
                    ->where([
                        ['users.id', '=', $user->id],
                        ['cart_items.item_id', '=', $item->id],
                    ])
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED]);

                if ($item->quantityUserPeriodValue > -1 && $item->quantityUserPeriodValue !== 0)
                    $qlQuery = $qlQuery->where('payments.updated_at', '>=', DB::raw("DATE_SUB(NOW(), INTERVAL CAST('" . $item->quantityUserPeriodValue . "' AS UNSIGNED) MINUTE)"));

                $quantityLimitTotal = $qlQuery->first();
                $quantityLimitTotal = empty($quantityLimitTotal) ? 0 : (int)$quantityLimitTotal->total;

                $quantityUserLimit = (int)$item->quantityUserLimit;
                $quantityUserCurrentLimit = $quantityLimitTotal;

                if ($quantityUserLimit <= $quantityUserCurrentLimit)
                    $is_unavailable = true;
            }

            // Handle cumulative category mode
            if ($category->is_cumulative == 1)
            {
                $cumulativeCategoryItems = collect($categoryItems)->pluck('id')->toArray();

                // Get all payments for belonged category for this user
                $purchasedItems = DB::table('cart_items')
                    ->join('carts', 'carts.id', '=', 'cart_items.cart_id')
                    ->join('payments', 'payments.cart_id', '=', 'carts.id')
                    ->join('items', 'items.id', '=', 'cart_items.item_id')
                    ->select([
                        'items.*',
                        DB::raw('items.price - ((items.discount / 100) * items.price) as calculated_price')
                    ])
                    ->whereIn('cart_items.item_id', $cumulativeCategoryItems)
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED])
                    ->where('payments.user_id', $user->id)
                    ->get();

                $highestPricedPurchasedItem = $purchasedItems->max('calculated_price') ?? 0;

                if ($item->price <= $highestPricedPurchasedItem) {
                    $is_unavailable = true;
                } else {
                    $is_unavailable = false;
                    $item->price = $item->price - $highestPricedPurchasedItem;
                }
            }

            // Generate a new item array for backend
            $newItem = [
                'id' => $item->id, // Item ID
                'name' => $item->name, // Item name
                'price' => ItemsController::getPrice($item), // Price
                'discount' => $discount, // Discount in percent (%)
                'active' => $item->active, // Item status for displaying
                'is_subs' => $item->is_subs, // Does items support subscriptions
                'custom_price' => $item->is_any_price, // Allow user to enter custom price
                'min_price' => $min_price, // Minimum price for custom price
                'quantityGlobalLimit' => $quantityGlobalLimit ?? null, // Global quantity limit
                'quantityGlobalCurrentLimit' => $quantityGlobalCurrentLimit ?? null, // Current value of global quantity limit
                'quantityUserLimit' => $quantityUserLimit ?? null, // User quantity limit
                'quantityUserCurrentLimit' => $quantityUserCurrentLimit ?? null, // Current value of user quantity limit
                'is_unavailable' => $is_unavailable, // Is item unavailable
                'allow_select_server' => $item->is_server_choice, // Allow user to select server
                'allowed_servers' => $allowed_servers, // Allowed servers
                'virtual_price' => $virtual_price, // Virtual price
                'is_virtual_currency_only' => $item->is_virtual_currency_only, // Is virtual currency only
                'image' => $item->image, // Path to item image
                'featured' => $item->featured, // Is item featured
            ];

            if ($category->is_comparison == 1) {
                $newItem['comparison'] = ItemComparison::where('item_id', $item->id)->select(['comparison_id', 'value'])->get();
            }

            $items[] = $newItem;
